import xml.etree.ElementTree as ET

def parse_xml(xml_file):
    """"""
    tree = ET.parse(xml_file)
    root = tree.getroot()
    labels = []

    def find_labels(element):
        labels.append(element.tag)
        for child in element:
            find_labels(child)
    find_labels(root)
    return sorted(labels)
